define('componentsRublix/Game',[
    'lib/react',
    'componentsRublix/shortHistory',
    'componentsRublix/tableHistory',
    'componentsRublix/chat',
    'componentsRublix/Chart',
    'componentsRublix/Controls',
    'componentsRublix/BetList',
    'componentsRublix/BetListGradient',
    'componentsRublix/magicWindow',
    'componentsRublix/OnlineCounter',
    'game-logic/engine'
], function (React,
             ShortHistoryClass,
             tableHistoryClass,
             chatClass,
             chartClass,
             controlsClass,
             betListClass,
             betListGradientClass,
             magicWindowClass,
             onlineCounterClass,
             Engine) {
    var shortHistory = React.createFactory(ShortHistoryClass);
    var chat = React.createFactory(chatClass);
    var chart = React.createFactory(chartClass);
    var controls = React.createFactory(controlsClass);
    var betList = React.createFactory(betListClass);
    var betListGradient = React.createFactory(betListGradientClass);
    var magicWindow = React.createFactory(magicWindowClass);
    var tableHisory = React.createFactory(tableHistoryClass);
    var onlineCounter = React.createFactory(onlineCounterClass);

    var D = React.DOM;

    return React.createClass({
        displayName: 'Game',

        getInitialState: function () {
            return {
                isConnected: Engine.isConnected
            }
        },

        componentDidMount: function () {
            Engine.on({
                'connected': this._onChange,
                'disconnected': this._onChange
            });
        },

        componentWillUnmount: function () {
            Engine.off({
                'connected': this._onChange,
                'disconnected': this._onChange
            });
        },

        _onChange: function () {
            if (this.state.isConnected != Engine.isConnected)
                this.setState({isConnected: Engine.isConnected});
        },

        render: function () {
            if (!this.state.isConnected)
                return D.p(null, 'Connecting to server..');
            React.render(shortHistory(),document.getElementById('history'));
            React.render(chat(),document.getElementById('chatContainer'));
            //React.render(chat(),document.getElementById('chatContainerMobi'));
            React.render(chart(),document.getElementById('graphic'));
            React.render(controls(),document.getElementById('controls'));
            React.render(betList(),document.getElementById('betLog'));
            React.render(betListGradient(),document.getElementById('gradientPanel'));
            React.render(magicWindow(),document.getElementById('magicWindow'));
            React.render(tableHisory(),document.getElementById('tableHistory'));
            //React.render(onlineCounter(),document.getElementById('onlineCounter'));
            //React.render(onlineCounter(),document.getElementById('onlineCounterMobi'));
            resizeWindow();
            scrollChat();
            scrollLog();
            return null;
            //D.render(shortHistory(),document.getElementById('history'));
        }
    });

});
